import React from 'react';
import './style/acesso.css';
import CT from './images/CT.jpg';
import Terrorist from './images/Terrorist.jpg';

export default () => {
    return(

    <div className="div_pai">

        <div className="selection">
            <img src={Terrorist} alt="Terrorist" width="100%" height="100%" id="border_img"></img>

        </div>

        <div className="selection">
            <img src={CT} alt="CounterTerrorist" width="100%" height="100%" id="border_img"></img>
            
        </div>

    </div>

)
}
